import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

import TransferCertificate from './Forms/TransferCertificate';
import Paragraph1 from './Forms/Paragraph1';
import Paragraph2 from './Forms/Paragraph2';
import Paragraph3 from './Forms/Paragraph3';
import Paragraph4 from './Forms/Paragraph4';
import Paragraph5 from './Forms/Paragraph5';
import Paragraph6 from './Forms/Paragraph6';
import Paragraph7 from './Forms/Paragraph7';

const Navbar = () => (
  <nav style={{ padding: '10px', backgroundColor: '#f0f0f0' }}>
    <Link to="/" style={{ margin: '0 10px' }}>Transfer Certificate</Link>
    <Link to="/para1" style={{ margin: '0 10px' }}>Paragraph 1</Link>
    <Link to="/para2" style={{ margin: '0 10px' }}>Paragraph 2</Link>
    <Link to="/para3" style={{ margin: '0 10px' }}>Paragraph 3</Link>
    <Link to="/para4" style={{ margin: '0 10px' }}>Paragraph 4</Link>
    <Link to="/para5" style={{ margin: '0 10px' }}>Paragraph 5</Link>
    <Link to="/para6" style={{ margin: '0 10px' }}>Paragraph 6</Link>
    <Link to="/para7" style={{ margin: '0 10px' }}>Paragraph 7</Link>
  </nav>
);

const App = () => {
  return (
    <Router>
      <div>
        <Navbar />
        <div style={{ padding: '20px' }}>
          <Routes>
            <Route path="/" element={<TransferCertificate />} />
            <Route path="/para1" element={<Paragraph1 />} />
            <Route path="/para2" element={<Paragraph2 />} />
            <Route path="/para3" element={<Paragraph3 />} />
            <Route path="/para4" element={<Paragraph4 />} />
            <Route path="/para5" element={<Paragraph5 />} />
            <Route path="/para6" element={<Paragraph6 />} />
            <Route path="/para7" element={<Paragraph7 />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
